import React, { useEffect, useState } from 'react'
import axios from 'axios'

const App = () => {

  const [myData, setMyData] = useState([])
  useEffect(() => {
    const getData = async () => {
      const { data } = await axios.get('/api/workspaces')
      setMyData(data)
    }
    getData()
  }, [])


  return (
    <>
      {myData.map(iter => <h1 key={iter._id}>{iter.long}-{iter.lat}</h1>)}
      {myData.map(iter => {
          return <Marker key={iter._id} longitude={iter.long} latitude={iter.lat}>
            <span onClick={() => setPopup(iter)}>
              {iter}
            </span>
          </Marker>
        })}
    </>
  )
}
export default App
